import {
    AuthErrPage,
    CompList, ErrorPage,
    HomeContainer, SteamAuth
} from "../views/pages";


export const authRoutes = [
    {
        path: '/auth',
        exact: true,
        auth: false,
        component: AuthErrPage
    },
    {
        path: '/compositions',
        exact: true,
        auth: true,
        component: CompList
    },
    {
        path: '/auth/steam',
        exact: true,
        auth: false,
        component: SteamAuth
    },
];

export const publicRoutes = [
    {
        path: '/',
        exact: true,
        component: HomeContainer
    },
    // {
    //     path: '/compositions',
    //     exact: true,
    //     component: CompList
    // },
    {
        path: '*',
        exact: true,
        component: ErrorPage
    }
];
